          </Route>

          <Route exact path="/contact" >
            <Contact />
          </Route> */}


    // <>
    // <Navbar />
    //   <switch>
    //     <Route exact path="/" component={About } />
    //     <Route exact path="/exercises" component={ Exercises } />
    //     <Route exact path="/diet" component={ Diet } />
    //     <Route exact path="/contact" component={ Contact } />
    //    </switch>
    // </>


export default App;
